// SPDX-License-Identifier: AGPL-3.0
pragma solidity 0.6.12;

contract A {
    bytes32 public trade = 0x00020000000000000005fbf64400d5992c000000000000000000000000000000;

    function getTradeType() public view returns (uint) {
        return uint256(uint8(bytes1(trade)));
    }

    function getMarketIndex() public view returns (uint) {
        return uint256(uint8(bytes1(trade << 8)));
    }

    function getFCashAmount() public view returns (uint) {
        return uint256(uint88(bytes11(trade << 16)));
    }

    function getMinSlippage() public view returns (uint) {
        return uint256(uint32(bytes4(trade << 104)));
    }

    function getPadding() public view returns (uint) {
        return uint256(uint120(bytes15(trade << 136)));
    }

    function encodeTrade() public view returns (bytes32) {
        uint8 tradeType = uint8(getTradeType());
        uint8 marketIndex = uint8(getMarketIndex());
        uint88 fCashAmount = uint88(getFCashAmount());
        uint32 minSlippage = uint32(getMinSlippage());
        uint120 padding = uint120(getPadding());

        bytes32 result = bytes32(uint(tradeType)) << 248;
        result |= bytes32(uint(marketIndex) << 240);
        result |= bytes32(uint(fCashAmount) << 152);
        result |= bytes32(uint(minSlippage) << 120);

        require(result == trade, "not same trade");
        return result;
    }
}
